const initialState = {
  conceptSequence: [],
};

function conceptSequenceReducer(state = initialState, action) {
  switch (action.type) {
    case 'ADD_CONCEPT_SEQUENCE':
      return {
        ...state,
        conceptSequence: action.payload,
      };
      default:
        return state;
  }
}

export default conceptSequenceReducer;
